package Trash;

public class num_pattern9 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=5;i>=1;i--) {
			for(int j=i;j<=5;j++) {
				System.out.print(j+" ");
			}
			System.out.println();
		}
	}

}
/*5 
  4 5 
  3 4 5 
  2 3 4 5 
  1 2 3 4 5   */ 
